/**
 * @param {number[]} nums
 * @return {number}
 */
var maximumStrongPairXor = function(nums) {
    nums.sort((a, b) => a - b);
    let max = 0;
    for (let i = 0; i < nums.length; i++) {
        for (let j = i + 1; j < nums.length && nums[j] <= nums[i] * 2; j++) {
            max = Math.max(max, nums[i] ^ nums[j]);
        }
    }
    return max;
};
